function App() {
  return (
    <div className="App">
      <Header>

      </Header>
      <ChakraProvider>
        <LandingSection />  
      </ChakraProvider>

      <h1>
        Welcome to my Portfolio Website
      </h1>
    </div>
  );
}

export default App;
